void insertion_sort(vector<float>& bucket) {
    for (int i = 1; i < bucket.size(); ++i) {
        float key = bucket[i];
        int j = i - 1;
        while (j >= 0 && bucket[j] > key) {
            bucket[j + 1] = bucket[j];
            j = j - 1;
        }
        bucket[j + 1] = key;
    }
}

void bucket_sort(float A[], int n) {
    float minVal = A[0];
    float maxVal = A[0];
    vector<float> B[n];

    for (int i = 1; i < n; i++) {
        if (A[i] < minVal) {
            minVal = A[i];
        }
        if (A[i] > maxVal) {
            maxVal = A[i];
        }
    }

    float range = maxVal - minVal;

    for (int i = 0; i < n; i++) {
        int bi = (n-1) * ((A[i] - minVal)/maxVal);
        B[bi].push_back(A[i]);
    }

    for (int i = 0; i < n; i++) {
        insertion_sort(B[i]);
    }

    int index = 0;
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < B[i].size(); j++) {
            A[index] = B[i][j];
            index = index + 1;
        }
    }
}

